import "./App.css";
import React from "react";

const NavBar = () => {
  return (
    <>
      <nav className="nav-bar">
        <ul>
          <li>Price</li>
          <li>About</li>
          <li>Contact</li>
        </ul>
      </nav>
    </>
  );
};

export default NavBar;
